オリジナルの甘酒レシピが、材料を入れて<br>
レンジで加熱して振るだけで出来る☆彡<br>
<br>
”ふりふり”手作り、ヘルシーで簡単おいしい♪<br>
<br>
甘酒は飲む点滴といわれるほど、栄養素が豊富な<br>
ドリンクとしても注目 d(^O^)b<br>
<br>
夏バテ、冬冷え対策にとってもＧｏｏｄ！<br>
<br>
☆【アレンジレシピ付き】<br>
・基本の甘酒<br>
・たまご酒<br>
・抹茶甘酒ラテ<br>
・甘酒バナナジュース<br>
・甘酒みかんシャーベット<br>
・甘酒パンケーキ<br>
・甘酒漬け(浅漬け/味噌漬け)<br>
<br>
作ってそのまま冷蔵、冷凍保存が出来る。<br>
<br>
キャップ、フタ、中トレイを外して、<br>
電子レンジＯＫ！！<br>
<br>
食洗機ＯＫ！！<br>
<br>
○容　量：３８０ml<br>
○商品サイズ：約 直径85×178mm<br><br>
≪品質表示≫<br>
キャップ、フタ、中トレイ、本体<br>
　　　　　ポリプロピレン／耐熱温度140度<br>
パッキン：シリコン樹脂／耐熱温度140度<br>
<br>【Made in China】<BR>

